import React from "react";

const Navigation = () => {
  return (
    <nav>
      <p
        style={{ display: "flex", justifyContent: "flex-end" }}
        className="f3 underline avenir dim pointer"
      >
        Sign Out
      </p>
    </nav>
  );
};
export default Navigation;
